import api from "../utils/api.js";

function Main(props) {
    return(
        <main>
            <section className="profile">
                <div className="profile__avatar-container">
                    <img className="profile__avatar" onClick={props.onEditAvatar} src="#" alt="Фото профиля" />
                </div>
                <div className="profile__info"> 
                    <div className="profile__container">
                        <h1 className="profile__name">Жак-Ив Кусто</h1>
                        <button onClick={props.onEditProfile} type="submit" className="profile__edit-button"></button>
                    </div>
                    <p className="profile__career">Исследователь океана</p>
                </div>
                <button onClick={props.onAddPlace} type="button" className="profile__add-button"></button>
            </section>

            <section className="grid-galery"></section>
        </main>
    );
}

export default Main;
